jQuery.githubContent=function(t,n,e){jQuery.getJSON("https://api.github.com/repos/"+t+"/"+n+"/contents?callback=?",e)},jQuery.fn.loadRepoContent=function(t,n){$.githubContent(t,n,function(t){var n=t.data;$(n).each(function(){if("dir"==this.type&&".vscode"!=this.name){var t=$("#listitem").clone();t.find("A").attr("href",this.name+"/"),t.find("STRONG").text(this.name.substring(0,8)),$("#list").append(t)}})})};